import Header from './Header'
import styled from 'styled-components'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

export default function Layout(props: any) {
  return (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  )
}
